@import 'transition-style';
@font-face {
  font-family: 'Arial Regular';
  src: url('fonts/PixelArialRegular.TTF') format('truetype');
  font-weight: normal;
  font-style: normal;
}
@font-face {
  font-family: 'Arial Bold';
  src: url('fonts/PixelArialBold.TTF') format('truetype');
  font-weight: bold;
  font-style: normal;
}

*,
*::before,
*::after {
  box-sizing: border-box;
  user-select: none;
}

*:focus {
  outline: 2px dashed rgb(169, 169, 169);
  outline-offset: 5px;
}

body {
  image-rendering: pixelated;
  margin: 0;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 12px;
  letter-spacing: 1.5px;
  min-height: 100vh;
  transition: all 0s;
}

button {
  cursor: pointer;
}

#blackScreen {
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  background-color: black;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
}

.foreground {
  --left: 0;
  position: absolute;
  width: 250%;
  bottom: 0;
  z-index: -1;
  left: calc(var(--left) * 1%);
}

.foreground-trees {
  --left: 0;
  position: absolute;
  width: 260%;
  bottom: -12%;
  z-index: -1;
  left: calc(var(--left) * 1%);
}

.mountains {
  --left: 0;
  position: absolute;
  width: 200%;
  bottom: -60%;
  z-index: -1;
  left: calc(var(--left) * 1%);
}

.world-container {
  border-radius: 8px;
  border: 2px solid #555;
  max-width: 1316px;
  max-height: 750px;
  overflow: hidden;
  position: relative;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 4px 12px;
}

.world {
  max-width: 1316px;
  overflow: hidden;

  position: relative;
}

.blink {
  animation: blinker 3s ease-in-out infinite;
}

@keyframes blinker {
  50% {
    opacity: 0;
  }
}

.sans {
  font-family: 'Press Start 2P', sans-serif;
  font-style: normal;
}

.body {
  font-family: 'Arial Regular';
  font-size: 12px;
  letter-spacing: 2px;
  line-height: 22px;
}

.submit-button {
  grid-column: span 6;
  border: 0px;
  background: #1e407c;
  color: #fff;
  padding: 12px 15px;
  width: 100%;
  letter-spacing: 3px;
  margin-top: 24px;
}

.submit-button:focus {
  outline: 2px dashed rgb(169, 169, 169);
  outline-offset: 5px;
  background-color: #222;
  color: white;
}

.submit-button:hover {
  background-color: #005fa9;
  color: white;
}

.lives-container {
  gap: 2px;
}

.lion-head-container {
  gap: 2px;
}

.score {
  font-style: normal;
}

.timer {
  position: absolute;
  top: 30%;
  left: 10%;
  transform: translate(-50%, 0%);
  font-style: normal;
}

.bottom-interface-container {
  bottom: 0px;
  width: 100%;
}

.show-page {
  opacity: 1;
  height: auto;
  pointer-events: all;
}

.hide-page {
  opacity: 0;
  height: 0px;
  pointer-events: none;
}

.hide-element {
  opacity: 0;
  pointer-events: none;
}
.show-element {
  display: flex !important;
  opacity: 1;
  pointer-events: auto;
}

.ticker-divider::before {
  content: '\2022'; /* Unicode character for a bullet point */
}

@keyframes ticker {
  0% {
    transform: translateX(0%);
  }
  100% {
    transform: translateX(-100%);
  }
}
@keyframes ticker2 {
  0% {
    transform: translateX(0%);
  }
  100% {
    transform: translateX(-100%);
  }
}
@keyframes ticker3 {
  0% {
    transform: translateX(0%);
  }
  100% {
    transform: translateX(-100%);
  }
}

/* Apply the ticker animation to an element */
.ticker-container {
  display: none;
  transition: all 0.2s ease-in-out;
  width: 100vw;
  flex-direction: row;
  padding-top: 4px;
  padding-bottom: 4px;
  padding-left: 12px;
  background-color: lightgray;
  white-space: nowrap; /* Prevent text from wrapping to the next line */
  overflow: hidden; /* Hide the overflow content */
}

.ticker-content {
  gap: 28px;
  align-items: center;
  display: flex; /* Display content inline so it scrolls horizontally */
  animation: ticker 30s linear infinite; /* Apply the ticker animation infinitely */
}

.ticker-content2 {
  gap: 28px;
  align-items: center;
  display: flex; /* Display content inline so it scrolls horizontally */
  animation: ticker2 30s linear infinite; /* Apply the ticker animation infinitely */
}

.ticker-content3 {
  gap: 28px;
  align-items: center;
  display: flex; /* Display content inline so it scrolls horizontally */
  animation: ticker3 30s linear infinite; /* Apply the ticker animation infinitely */
}

.ticker__item {
  font-family: 'Roboto Mono';
}

.ticker-container:hover .ticker-content2 {
  animation-play-state: paused;
}
.ticker-container:hover .ticker-content {
  animation-play-state: paused;
}
.ticker-container:hover .ticker-content3 {
  animation-play-state: paused;
}

