  display: flex;
  justify-content: center;
}

.combo-timer-bar {
  width: 100%;
  min-width: 125px;
  position: relative;
  background-color: rgba(30, 64, 124, 0.3);
}

.inner-plus-points {
  width: fit-content;
  -webkit-text-stroke: 0.5px white; /* width and color */
  color: white;
  animation: fadeDown 0.6s forwards; /* Animation for fade in with upward translate */
  transition: opacity 0.6s; /* Add a transition for the opacity property over 1 second */
}

@keyframes fadeDown {
  0% {
    opacity: 0;
    transform: translate(-50%, -50%) translateX(-30px) scale(0.8);
  }
  50% {
    opacity: 1;
    transform: translate(-50%, -50%) translateX(0px) translateY(0) scale(1.1);
  }
  100% {
    opacity: 0;
    transform: translate(-50%, -50%) translateY(10px) scale(1);
  }
}

.pop-up-gold-coin {
  width: 38px;
  height: 38px;
  image-rendering: pixelated; /* Prevent blurriness between images */
  transition: all 0.3s ease-in-out !important;
  animation: shineGoldCoin 1.25s infinite, upRight 1.1s forwards,
    flashlight 0.2s infinite alternate; /* You can adjust the duration and timing function */
}

@keyframes shineGoldCoin {
  0% {
    background-image: url('./imgs/gold-coin/Gold-Coin-1.png');
  }
  20% {
    background-image: url('./imgs/gold-coin/Gold-Coin-2.png');
  }
  40% {
    background-image: url('./imgs/gold-coin/Gold-Coin-3.png');
  }
  60% {
    background-image: url('./imgs/gold-coin/Gold-Coin-4.png');
  }
  80% {
    background-image: url('./imgs/gold-coin/Gold-Coin-5.png');
  }
  100% {
    background-image: url('./imgs/gold-coin/Gold-Coin-1.png');
  }
}

@keyframes upRight {
  0% {
    opacity: 0.3;
    transform: translate(-50%, -50%) translateX(0px) translateY(-60px) scale(0);
  }
  50% {
    opacity: 1;
    transform: translate(-50%, -50%) translateX(0px) translateY(-300px) scale(1);
  }
  100% {
    opacity: 0.3;
    transform: translate(-50%, -50%) translateX(0px) translateY(400px)
      scale(0.3);
  }
}

.timer-progress {
  width: 100%; /* Set the desired width for your progress bar */
